Переговоры Путина и Эрдогана в Сочи завершились. Встреча длилась более 4 часов. 

Президенты по итогам переговоров приняли совместное заявление:

— Путин и Эрдоган договорились наращивать объем торговли РФ и Турции, идти навстречу ожиданиям обеих сторон по вопросам энергетики;

— Президенты договорились наращивать взаимодействие РФ и Турции в транспортной сфере, промышленности, сельском хозяйстве, строительстве;

— Путин и Эрдоган, «несмотря на текущие региональные и глобальные вызовы», подтвердили волю России и Турции к дальнейшему развитию отношений;

— Президенты подчеркнули ключевое значение доверительных отношений РФ и Турции для достижения региональной и международной стабильности.

